const items = [1,2,3];
const combinations = [];
function generateCombinations(arr, size, start, temp) {
  if (temp.length === size) {
    combinations.push([...temp]);
    return;
  }
  for (let i = start; i < arr.length; i++) {
    temp.push(arr[i]);
    generateCombinations(arr, size, i + 1, temp);
    temp.pop();
  }
}
for (let i = 1; i <= items.length; i++) {
  generateCombinations(items, i, 0, []);
}
